import React, { useEffect, useState } from 'react';
import axios from 'axios';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import CategoryFilter from './CategoryFilter';
import ProductForm from './ProductForm';

const Section = styled.section`
    padding: 80px 20px;
    background: ${props => props.theme.colors.background};
    color: ${props => props.theme.colors.text};
    text-align: center;
`;

const Title = styled.h2`
    font-size: 2rem;
    letter-spacing: 0.2rem;
`;

const Button = styled.button`
    margin-top: 20px;
    padding: 10px 20px;
    background: ${props => props.theme.colors.accent};
    color: ${props => props.theme.colors.text};
    border: none;
    border-radius: 4px;
    cursor: pointer;
    font-size: 1rem;
    letter-spacing: 0.1rem;
    &:hover {
        opacity: 0.8;
    }
`;

const ProductGrid = styled.div`
    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(220px, 1fr));
    gap: 20px;
    margin-top: 40px;
`;

const ProductCard = styled(motion.div)`
    border: 1px solid ${props => props.theme.colors.text};
    padding: 20px;
    border-radius: 8px;
    cursor: pointer;
    &:hover {
        transform: scale(1.05);
    }
`;

function ProductList() {
    const [products, setProducts] = useState([]);
    const [selectedCategory, setSelectedCategory] = useState('');
    const [showForm, setShowForm] = useState(false);

    // 封装获取产品的函数，根据 selectedCategory 进行筛选
    const fetchProducts = () => {
        const url = selectedCategory
            ? `http://localhost:8081/api/products?categoryId=${selectedCategory}`
            : 'http://localhost:8081/api/products';
        axios.get(url)
            .then(response => setProducts(response.data))
            .catch(error => console.error('Error fetching products:', error));
    };

    useEffect(() => {
        fetchProducts();
    }, [selectedCategory]);

    // 生成测试数据的函数（和之前示例类似）
    const generateTestData = async () => {
        const testData = [
            {
                name: 'Neon Case',
                description: 'Bright neon phonecase with glowing edges',
                price: 15.99,
                stock: 50,
                image_url: 'https://example.com/images/neon.jpg',
                category_id: 1
            },
            {
                name: 'Marble Case',
                description: 'Stylish marble pattern phonecase',
                price: 25.49,
                stock: 30,
                image_url: 'https://example.com/images/marble.jpg',
                category_id: 2
            },
            {
                name: 'Carbon Fiber Case',
                description: 'Lightweight carbon fiber design',
                price: 29.99,
                stock: 20,
                image_url: 'https://example.com/images/carbon.jpg',
                category_id: 3
            },
            {
                name: 'Floral Case',
                description: 'Colorful floral pattern, perfect for spring',
                price: 12.99,
                stock: 100,
                image_url: 'https://example.com/images/floral.jpg',
                category_id: 4
            },
            {
                name: 'Retro Case',
                description: 'Vintage 80s design with vibrant colors',
                price: 19.99,
                stock: 40,
                image_url: 'https://example.com/images/retro.jpg',
                category_id: 5
            }
        ];

        try {
            for (let product of testData) {
                await axios.post('http://localhost:8081/api/products', product);
            }
            alert('Test data generated successfully!');
            fetchProducts();
        } catch (error) {
            console.error('Error generating test data:', error);
            alert('Failed to generate test data. Check console for details.');
        }
    };

    // 删除产品
    const deleteProduct = async (id) => {
        try {
            await axios.delete(`http://localhost:8081/api/products/${id}`);
            fetchProducts();
        } catch (error) {
            console.error('Error deleting product:', error);
            alert('Failed to delete product.');
        }
    };

    return (
        <Section id="shop">
            <Title>Featured Products</Title>

            {/* 分类下拉筛选 */}
            <CategoryFilter onChange={(value) => setSelectedCategory(value)} />

            {/* 生成测试数据按钮 */}
            <Button onClick={generateTestData}>Generate Test Data</Button>

            {/* 切换显示新增产品表单 */}
            <Button onClick={() => setShowForm(!showForm)}>
                {showForm ? 'Hide Form' : 'Add New Product'}
            </Button>
            {showForm && <ProductForm onSuccess={fetchProducts} />}

            <ProductGrid>
                {products.length === 0 ? (
                    <p>No products available.</p>
                ) : (
                    products.map(product => (
                        <ProductCard
                            key={product.id}
                            initial={{ opacity: 0 }}
                            animate={{ opacity: 1 }}
                            transition={{ duration: 0.5 }}
                        >
                            <h3>{product.name}</h3>
                            <p>${product.price}</p>
                            <p>Stock: {product.stock}</p>
                            {/* 添加删除按钮 */}
                            <Button onClick={() => deleteProduct(product.id)}>Delete</Button>
                        </ProductCard>
                    ))
                )}
            </ProductGrid>
        </Section>
    );
}

export default ProductList;
